import React from 'react'
import {ContactContainer,ContactH1} from './ContactElements';
import {Form,FormGroup,Input} from 'reactstrap';
import emailjs from 'emailjs-com';

const Contact = () => {

    function sendEmail(e) {
        e.preventDefault();
    
        emailjs.sendForm('YOUR_SERVICE_ID', 'YOUR_TEMPLATE_ID', e.target, 'YOUR_USER_ID')
          .then((result) => {
              console.log(result.text);
          }, (error) => {
              console.log(error.text);
          });
      }

    return (
            <ContactContainer>
            <ContactH1>Contact</ContactH1>
            <Form width="100px">
                <FormGroup>
                    <Input type="name" name="name" id="name" placeholder="NAME" ></Input>
                </FormGroup>
                <FormGroup>
                <Input type="name" name="name" id="name" placeholder="NAME" ></Input>
                </FormGroup>
                <FormGroup>
                <Input type="message" name="message" id="message" placeholder="MESSAGE"></Input>
                </FormGroup>
            </Form>
            <form className="contact-form" onSubmit={sendEmail}>
            <input type="hidden" name="contact_number" />
            <label>Name</label>
            <input type="text" name="user_name" />
            <label>Email</label>
            <input type="email" name="user_email" />
            <label>Message</label>
            <textarea name="message" />
            <input type="submit" value="Send" />
          </form>
          </ContactContainer>
    );
}

export default Contact;
